# ALTER TABLE europe ADD id int NOT NULL AUTO_INCREMENT primary key;

CREATE TABLE europe (
    `record_id` INT,
    `continent` VARCHAR(2) CHARACTER SET utf8,
    `status` VARCHAR(10) CHARACTER SET utf8,
    `sporder` VARCHAR(14) CHARACTER SET utf8,
    `family` VARCHAR(16) CHARACTER SET utf8,
    `genus` VARCHAR(15) CHARACTER SET utf8,
    `species` VARCHAR(19) CHARACTER SET utf8,
    `log_mass_g` NUMERIC(3, 2),
    `comb_mass_g` NUMERIC(8, 1),
    `reference` VARCHAR(23) CHARACTER SET utf8
);
